import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';

function CsvLoader({ onDataLoaded }) {
    const [data, setData] = useState([]);

    useEffect(() => {
        Papa.parse('/Counties for Texas Agricultural Statistical Districts.csv', {
            download: true,
            header: true,  // Ensure this is set to match the CSV headers
            complete: (results) => {
                console.log('Parsed CSV Data:', results.data);  // Log the parsed data
                setData(results.data);  // Set the parsed data to state
                onDataLoaded(results.data);  // Pass data back to the parent component
            },
            error: (error) => {
                console.error('Error parsing CSV:', error);
            },
        });
    }, []);

    return null;  // No need to render anything
}

export default CsvLoader;
